syntax = "proto3";

option go_package = "github.com/dstreamcloud/proto/pbgo/resources/user;user_pb";
package user;

message V1 {
    string id = 1;
    int64 createdAtUs = 2;
    int64 updatedAtUs = 3;

    string name = 11;
    string organizationID = 12;
    repeated Credential credentials = 13;

    message Credential {

    }
}

